#
# TABLE STRUCTURE FOR: data_presensi
#

DROP TABLE IF EXISTS `data_presensi`;

CREATE TABLE `data_presensi` (
  `id_p_karyawan` int(11) NOT NULL AUTO_INCREMENT,
  `id_karyawan` bigint(20) DEFAULT NULL,
  `tanggal` date DEFAULT NULL,
  `jam_mulai` time DEFAULT NULL,
  `jam_selesai` time DEFAULT NULL,
  `kode_shift` varchar(50) DEFAULT NULL,
  `kode_ijin` varchar(50) DEFAULT NULL,
  `kode_hari_libur` varchar(50) DEFAULT NULL,
  `no_spl` varchar(50) DEFAULT NULL,
  `no_perjalanan_dinas` varchar(255) DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `create_by` bigint(20) DEFAULT NULL,
  `update_by` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id_p_karyawan`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=12796 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;



